import React, { useState } from 'react';
import './Helpline.css'; // Import the corresponding CSS file for styling

const Helpline = () => {
  const [selectedRegion, setSelectedRegion] = useState('');

  const contactData = {
    dharwad: {
      counselor: {
        name: 'Dr. Sugnyani Patil',
        phone: '+91-8310955958',
        email: 'manoshanthidharwad@gmail.com',
      },
      police: {
        name: 'Dharwad Police Station',
        phone: '+91-8362233512',
      },
    },
    hubli: {
      counselor: {
        name: 'Dr. Girish Babu',
        phone: '+91-9448091780',
        email: 'hubli@manoshanti.com',
      },
      police: {
        name: 'Hubli Police Station',
        phone: '+91-8362233540',
      },
    },
    navalgund: {
      counselor: {
        name: 'Dr. Sugnyani Patil',
        phone: '+91-8310955958',
        email: 'manoshanthidharwad@gmail.com',
      },
      police: {
        name: 'Navalgund Police Station',
        phone: '+91-8380229233',
      },
    },
    kundgol: {
      counselor: {
        name: 'Dr. Sugnyani Patil',
        phone: '+91-8310955958',
        email: 'manoshanthidharwad@gmail.com',
      },
      police: {
        name: 'Kundgol Police Station',
        phone: '+91-8304290343',
      },
    },
    kalghatgi: {
      counselor: {
        name: 'Dr. Sugnyani Patil',
        phone: '+91-8310955958',
        email: 'manoshanthidharwad@gmail.com',
      },
      police: {
        name: 'Kalghatgi Police Station',
        phone: '+91-8370284511',
      },
    },
  };

  const handleSelectChange = (e) => {
    setSelectedRegion(e.target.value);
  };

  const selectedContact = contactData[selectedRegion];

  return (
    <div>
      <header>
        <div className="header">
          <h1>Marriage Counseling</h1>
        </div>
        <div className="pannel">
          <div className="pannel-opt">
            <a href="index.html">Home</a>
            <a href="about.html">About</a>
            <a href="blog.html">Blogs</a>
            <a href="ques.html">Self Assessment</a>
            <a href="helpline.html" style={{ fontWeight: 'bold' }}>Helpline</a>
            <a href="feedback.html">Feedback</a>
          </div>
        </div>
      </header>

      <main>
        <div className="map-container">
          <div className="dropdown">
            <select
              id="taluka-select"
              className="styled-select"
              value={selectedRegion}
              onChange={handleSelectChange}
            >
              <option value="" disabled selected>
                Select your region
              </option>
              <option value="dharwad">Dharwad</option>
              <option value="hubli">Hubli</option>
              <option value="navalgund">Navalgund</option>
              <option value="kundgol">Kundgol</option>
              <option value="kalghatgi">Kalghatgi</option>
            </select>
          </div>

          <div id="Map">
            <img
              src={`${selectedRegion}-taluka-map.jpg`}
              alt={`${selectedRegion} Taluka Map`}
              id="map-image"
            />
          </div>

          {selectedRegion && (
            <div id="contact-info" className="contact-container">
              <div style={{ display: 'flex', justifyContent: 'space-between' }}>
                <div style={{ flex: 1, marginRight: 10, textAlign: 'center' }}>
                  <h3>Counselor Information</h3>
                  <p><strong>{selectedContact.counselor.name}</strong></p>
                  <p>Phone: {selectedContact.counselor.phone}</p>
                  <p>Email: {selectedContact.counselor.email}</p>
                  <a
                    href={`tel:${selectedContact.counselor.phone}`}
                    className="call-button"
                  >
                    Call Counselor
                  </a>
                </div>

                <div style={{ flex: 1, textAlign: 'center' }}>
                  <h3>Police Station Information</h3>
                  <p><strong>{selectedContact.police.name}</strong></p>
                  <p>Phone: {selectedContact.police.phone}</p>
                  <a
                    href={`tel:${selectedContact.police.phone}`}
                    className="call-button"
                  >
                    Call Police Station
                  </a>
                </div>
              </div>
            </div>
          )}
        </div>
      </main>

      <footer>
        <p>&copy; 2024 Marriage Counseling. All Rights Reserved.</p>
      </footer>
    </div>
  );
};

export default Helpline;
